import React from "react"
import { ListItem, Card, CardActions, CardContent, Typography, Button } from "@material-ui/core";

class Item extends React.Component {
    constructor(props) {
        super(props);
        this.state = {item : props.item};
    }

    render() {
        const item = this.state.item;

        return (
          <ListItem>
            <Card  sx={{ margin : "30"}} >
              <CardContent>
                <Typography
                  sx={{ fontSize: 14 }}
                  color="text.secondary"
                  gutterBottom>
                      {item.type}
                </Typography>
                <Typography variant="h5" component="div">
                  {item.title}
                </Typography>
                <Typography sx={{ mb: 1.5 }} color="text.secondary">
                    <br />
                  {item.sale}
                </Typography>
              </CardContent>
              <CardActions>
                <Button size="small">Learn More</Button>
              </CardActions>
            </Card>
          </ListItem>
        );
    }
}

export default Item;
